function Test () {

	const [ elLibro , setElLibro ] = useState();

	useEffect(() => {
		const api = "https://www.googleapis.com/books/v1/volumes?q=papelucho";
		
		fetch( api )
		.then( libro => libro.json() )
		.then( libro => {
			console.log( libro );
			console.log( libro[ 0 ] );
			// console.log( libro[ 0 ].items.volumeInfo.title );
			setElLibro( libro );
		});
		
	},[]);
	

	return (
		<section className="test">
			<h2>Libros</h2>
		</section>
	);
};

export default Test;
